import React, {Component} from "react";
import {
  Text,
  View, 
  Image, 
  Dimensions, 
  ImageBackground,
  StyleSheet
} from "react-native";
import {Grid, Col, Row} from "react-native-easy-grid";
import {DashedProgress} from 'react-native-dashed-progress';
import {
  widthPercentageToDP as wp,
  heightPercentageToDP as hp,
  listenOrientationChange as loc,
  removeOrientationListener as rol
} from 'react-native-responsive-screen';
import { ScaledSheet } from 'react-native-size-matters';
import { s, vs, ms, mvs } from 'react-native-size-matters';

const { height, width } = Dimensions.get("window");

const Compasss =(props) => {
 
  _direction = degree => {
    if (degree >= 22.5 && degree < 67.5) {
      return "NE";
    } else if (degree >= 67.5 && degree < 112.5) {
      return "E";
    } else if (degree >= 112.5 && degree < 157.5) {
      return "SE";
    } else if (degree >= 157.5 && degree < 202.5) {
      return "S";
    } else if (degree >= 202.5 && degree < 247.5) {
      return "SW";
    } else if (degree >= 247.5 && degree < 292.5) {
      return "W";
    } else if (degree >= 292.5 && degree < 337.5) {
      return "NW";
    } else {
      return "N";
    }
  };

  return (
    <Grid >
      <ImageBackground source={require('../images/safaa.png')} style={styles.action}>
        <Row 
          style={{
            alignItems: "center",        
          }} 
          size={2}>
          <Col style={{alignItems: "center"}}>
            <ImageBackground
              source={require("../images/DRTTT.png")}
              style={{
                height: hp("46%"),
                width: wp("46%"),
                ///justifyContent: "center",
                /// alignItems: "center",
                resizeMode: "contain",
                marginTop: hp("2%"),
                //marginLeft:20,
                transform: [
                  {rotate:180+ "deg"},
                ],
              }}
            >
              <View 
                style={{
                  justifyContent: 'center', 
                  alignItems: 'center',
                  marginTop: hp("9%"), 
                  marginLeft:wp("-1%"),
         
                  transform: [{rotate:-180+ "deg"}]
                }}
              >
                <View  style={{marginTop: hp("14%")}}>
                  <DashedProgress
                      fill={props.dataa} //30%  50*30/100
                      countBars={50} 
                      radius={62}
                      indicatorWidth={ wp("11%")}
                      barWidth={wp("6%")}
                      strokeThickness={wp("1.2%")}
                      text={props.dataa+"Km/h"}
                      showIndicator={false}
                      trailColor="#8EBCE4"
                      strokeColor="#3D57A7"
                      tooltipSize={ wp("5%")}
                  />
                </View>
              </View>
            </ImageBackground>
          </Col>
        </Row>
      </ImageBackground>
    </Grid>
  );
}

export default Compasss;

const styles = StyleSheet.create({
  action: {
    //marginTop: hp("-9%"),
    //marginLeft:56,
    width: wp("68%"),
    position:"absolute",
    height: hp("43%"),
  }
})
